// Network
std::pair<int, std::vector<ADDRESS> > GetAddresses()
{
  std::vector<ADDRESS> addresses;
#ifdef _WIN32
  ULONG size = 25000; // We allocate a large buffer because we don't want to query all the devices many times because Microsoft says this is an expensive operation
  std::unique_ptr<char[]> buffer = std::make_unique<char[]>(size);
  ULONG ret = 0;
  for (int i = 0; i < 15; ++i) // We loop because the size required can change between requests, so we attempt a set number of times
  {
    ret = ::GetAdaptersAddresses(AF_UNSPEC, GAA_FLAG_INCLUDE_GATEWAYS | GAA_FLAG_INCLUDE_ALL_INTERFACES, nullptr, reinterpret_cast<IP_ADAPTER_ADDRESSES*>(buffer.get()), &size);
    if (ret == ERROR_SUCCESS)
    {

      break;
    }
    else if (ret == ERROR_BUFFER_OVERFLOW) // Reallocate
    {
      size += size;
      buffer = std::make_unique<char[]>(size);
    }
    else
    {

      return std::make_pair(1, std::vector<ADDRESS>());
    }
  }

  if (ret != ERROR_SUCCESS)
  {

    return std::make_pair(2, std::vector<ADDRESS>());
  }

  const IP_ADAPTER_ADDRESSES* adaptersaddresses = reinterpret_cast<IP_ADAPTER_ADDRESSES*>(buffer.get());
  while (adaptersaddresses)
  {
    IP_ADAPTER_UNICAST_ADDRESS* unicastaddress = adaptersaddresses->FirstUnicastAddress;
    while (unicastaddress)
    {
      if ((unicastaddress->SuffixOrigin == NlsoWellKnown) || (unicastaddress->SuffixOrigin == IpSuffixOriginManual) || (unicastaddress->SuffixOrigin == IpSuffixOriginLinkLayerAddress) || (unicastaddress->SuffixOrigin == IpSuffixOriginDhcp))
      {
        if ((unicastaddress->Address.lpSockaddr->sa_family == AF_INET) || (unicastaddress->Address.lpSockaddr->sa_family == AF_INET6))
        {
          boost::system::error_code err;
          const boost::asio::ip::address address = boost::asio::ip::address::from_string(utility::ToString(reinterpret_cast<sockaddr_in*>(unicastaddress->Address.lpSockaddr)), err);
          if (!err && !address.is_unspecified())
          {
            addresses.emplace_back(adaptersaddresses->AdapterName, address.to_string(), PrefixToSubnetMask(unicastaddress->OnLinkPrefixLength));

          }
        }
      }

      unicastaddress = unicastaddress->Next;
    }

    adaptersaddresses = adaptersaddresses->Next;
  }
#elif defined(__linux__) && !defined(__ANDROID__)
  struct ifaddrs* ifaddrs;
  if (getifaddrs(&ifaddrs))
  {

    return std::make_pair(1, std::vector<ADDRESS>());
  }
  
  for (struct ifaddrs* ifaddr = ifaddrs; ifaddr; ifaddr = ifaddr->ifa_next)
  {
    if (ifaddr->ifa_addr->sa_family == AF_INET)
    {
      struct sockaddr_in* sa = reinterpret_cast<struct sockaddr_in*>(ifaddr->ifa_addr);
      const std::string nm = inet_ntoa(reinterpret_cast<struct sockaddr_in*>(ifaddr->ifa_netmask)->sin_addr);
      addresses.push_back(ADDRESS(ifaddr->ifa_name, inet_ntoa(sa->sin_addr), nm));
    }
  }
  freeifaddrs(ifaddrs);
#endif
  return std::make_pair(0, addresses);
}

bool IsValidSubnetMask(const uint32_t subnetmask)
{
  if (subnetmask == 0)
  {

    return 0;
  }

  if (subnetmask & (~subnetmask >> 1))
  {

    return 0;
  }
  else
  {
    
    return 1;
  }
}

