std::vector<uint8_t> HexToData(const std::string& text)
{
  std::vector<uint8_t> result;
  for (int i = 0; i < (text.length() - 1); i += 2)
  {
    if (!std::isxdigit(text.at(i)) || !std::isxdigit(text.at(i+1)))
    {

      return result;
    }

    const auto data = strtoul(text.substr(i, 2).c_str(), nullptr, 16);
    result.push_back(static_cast<uint8_t>(data));
  }
  return result;
}

