uint64_t FactorialDivide(unsigned int min, unsigned int max)
{
  uint64_t result = 1;
  for (unsigned int i = min + 1; i <= max; ++i)
  {
    result *= i;

  }

  return result;
}

uint64_t Factorial(unsigned int value)
{
  uint64_t result = 1;
  for (unsigned int i = 2; i <= value; ++i)
  {
    result *= i;

  }

  return result;
}

std::vector<int> SplitDigits(int number)
{
  if (number == 0)
  {

    return std::vector<int>({ 0 });
  }

  std::vector<int> result;
  while (number != 0)
  {
    int last = number % 10;
    result.insert(result.begin(), last);
    number = (number - last) / 10;
  }
  return result;
}

// Encoding
std::array<unsigned char, 32> Sha256(const std::string& text)
{
  return Sha256(reinterpret_cast<const unsigned char*>(text.data()), text.size());
}

std::array<unsigned char, 32> Sha256(unsigned char const* data, const size_t length)
{
  std::array<unsigned char, 32> digest;
  SHA256_CTX ctx;
  SHA256_Init(&ctx);
  SHA256_Update(&ctx, data, length);
  SHA256_Final(digest.data(), &ctx);
  return digest;
}

