std::string Md5(const void* data, size_t size)
{
  // Openssl MD5
  unsigned char md5[MD5_DIGEST_LENGTH];
  MD5(reinterpret_cast<const unsigned char*>(data), size, md5);
  
  // Convert hex characters to a string
  std::string result;
  result.reserve(16);
  for (int i = 0; i < sizeof(md5); ++i)
  {
    unsigned char hex = md5[i];
    char chars[3] = { HEXCHARS[hex >> 4], HEXCHARS[hex & 0xF], 0 };
    result.append(chars);
  }

  return result;
}

