std::string Base64Encode(const unsigned char* data, const size_t length)
{
  BUF_MEM* buffer = nullptr;

  BIO* b64 = BIO_new(BIO_f_base64());
  BIO* bio = BIO_new(BIO_s_mem());
  bio = BIO_push(b64, bio);

  BIO_set_flags(bio, BIO_FLAGS_BASE64_NO_NL);
  BIO_write(bio, data, static_cast<int>(length));
  BIO_flush(bio);
  BIO_get_mem_ptr(bio, &buffer);

  const std::string result(buffer->data, buffer->length);
  
  BIO_free_all(bio);

  return result;
}

// Takes input by value because BIO_new_mem_buf is not const aware
std::vector<unsigned char> Base64Decode(std::string input)
{
  if ((input.size() % 4) || (input.size() < 3))
  {

    return std::vector<unsigned char>();
  }

  // Pre calculate the length of the buffer
  size_t padding = 0;
  if (input[input.size()-1] == '=' && input[input.size()-2] == '=') // Last two chars are =
    padding = 2;
  else if (input[input.size()-1] == '=') // Last char is =
    padding = 1;

  size_t length = (input.size()*3)/4 - padding;

  BIO* bio = BIO_new_mem_buf(const_cast<char*>(input.data()), -1);
  BIO* b64 = BIO_new(BIO_f_base64());
  bio = BIO_push(b64, bio);

  std::unique_ptr<unsigned char[]> buffer = std::make_unique<unsigned char[]>(length+1);
  std::memset(buffer.get(), 0, length+1);
  
  BIO_set_flags(bio, BIO_FLAGS_BASE64_NO_NL);
  length = BIO_read(bio, buffer.get(), static_cast<int>(input.size()));
  BIO_free_all(bio);

  std::vector<unsigned char> result;
  for (int i = 0; i < length; ++i)
  {
    result.push_back(buffer.get()[i]);

  }
  return result;
}

std::string XMLEscape(const std::string& xml)
{
  std::string result = xml;
  boost::algorithm::replace_all(result, "&", "&amp;");
  boost::algorithm::replace_all(result, "\"", "&quot;");
  boost::algorithm::replace_all(result, "\'", "&apos;");
  boost::algorithm::replace_all(result, "<", "&lt;");
  boost::algorithm::replace_all(result, ">", "&gt;");
  return result;
}

