void SwapBit(unsigned char* data, unsigned int lhs, unsigned int rhs)
{
  const unsigned int lhsbit = (lhs % 8);
  const unsigned int rhsbit = (rhs % 8);
  const unsigned int lhsbyte = (lhs - lhsbit) / 8;
  const unsigned int rhsbyte = (rhs - rhsbit) / 8;

  // Get the bits
  const unsigned char tmplhs = data[lhsbyte] & (0b00000001 << lhsbit);
  const unsigned char tmprhs = data[rhsbyte] & (0b00000001 << rhsbit);

  // Zero out the bits in both
  data[lhsbyte] = data[lhsbyte] & ~(0b00000001 << lhsbit);
  data[rhsbyte] = data[rhsbyte] & ~(0b00000001 << rhsbit);

  // Set them back with the new bit changed
  if (tmplhs)
  {
    data[rhsbyte] = data[rhsbyte] | (0b00000001 << rhsbit);

  }

  if (tmprhs)
  {
    data[lhsbyte] = data[lhsbyte] | (0b00000001 << lhsbit);

  }
}

std::vector< std::pair<unsigned int, unsigned int> > GenerateRandomSequence(unsigned int seed, unsigned int miniterations, unsigned int max)
{
  std::vector< std::pair<unsigned int, unsigned int> > result;

  boost::mt19937 engine(static_cast<unsigned int>(seed)); // We use a boost engine and distribution because they are consistent accross platforms
  const int numiterations = miniterations + boost::uniform_int<unsigned int>(0, miniterations)(engine); // Vary the number of total iterations
  boost::uniform_int<unsigned int> dist(0, max);
  
  for (int i = 0; i < numiterations; ++i)
  {
    result.push_back(std::make_pair(dist(engine), dist(engine)));

  }

  return result;
}

size_t RoundPage(const size_t value)
{
  if (value == 0)
  {

    return 0;
  }

  return (value - (value % 4096));
}

uint64_t RoundUp(const uint64_t value, const uint64_t multiple)
{
  if (multiple == 0)
  {

    return value;
  }

  const uint64_t remainder = value % multiple;
  if (remainder == 0)
  {

    return value;
  }

  return value + multiple - remainder;
}

