// Aligned allocation
void* AlignedMalloc(const size_t size, const size_t alignment)
{
  const size_t offset = alignment - 1 + sizeof(void*);
  void* buffer = malloc(size + offset);
  void** ptr = reinterpret_cast<void**>((reinterpret_cast<size_t>(buffer)+offset) & ~(alignment - 1));
  ptr[-1] = buffer;
  return ptr;
}

void AlignedFree(void* ptr)
{
  free((static_cast<void**>(ptr))[-1]);
}

// Chrono
std::string ToISOString(const std::chrono::system_clock::time_point timepoint)
{
  const std::time_t tm = std::chrono::system_clock::to_time_t(timepoint);
  struct tm gm;
#ifdef _WIN32
  gmtime_s(&gm, &tm);
#else
  gmtime_r(&tm, &gm);
#endif
  std::stringstream month; month << std::setfill('0') << std::setw(2) << gm.tm_mon + 1;
  std::stringstream day; day << std::setfill('0') << std::setw(2) << gm.tm_mday;
  std::stringstream hours; hours << std::setfill('0') << std::setw(2) << gm.tm_hour;
  std::stringstream minutes; minutes << std::setfill('0') << std::setw(2) << gm.tm_min;
  std::stringstream seconds; seconds << std::setfill('0') << std::setw(2) << gm.tm_sec;
  std::stringstream microseconds; microseconds << std::setfill('0') << std::setw(6) << (std::chrono::duration_cast<std::chrono::microseconds>(timepoint.time_since_epoch()).count() % 1000000);
  return (std::to_string(gm.tm_year + 1900) + '-' + month.str() + '-' + day.str() + 'T' + hours.str() + ':' + minutes.str() + ':' + seconds.str() + "." + microseconds.str() + "Z");
}

// Compression
int Compress(z_stream& zstream, const char* data, const size_t size, std::vector<char>& buffer)
{
  if (deflateReset(&zstream) != Z_OK)
  {

    return 1;
  }

  const auto bound = deflateBound(&zstream, static_cast<uLong>(size));
  buffer.resize(bound);

  zstream.avail_in = static_cast<uInt>(size);
  zstream.next_in = reinterpret_cast<Bytef*>(const_cast<char*>(data)); // Hopefully we can trust zlib not to screw with the input data???
  zstream.avail_out = bound;
  zstream.next_out = reinterpret_cast<Bytef*>(buffer.data());
  const int ret = deflate(&zstream, Z_FINISH);
  if (ret != Z_STREAM_END)
  {

    return 2;
  }
  buffer.resize(zstream.total_out);
  return 0;
}

int Decompress(z_stream& zstream, const char* data, const size_t size, std::vector<char>& buffer)
{
  if (inflateReset(&zstream) != Z_OK)
  {

    return 1;
  }

  if (buffer.empty())
  {
    buffer.resize(4096);

  }

  while (true)
  {
    zstream.avail_in = static_cast<uInt>(size - zstream.total_in);
    zstream.next_in = reinterpret_cast<Bytef*>(const_cast<char*>(data + zstream.total_in));
    zstream.avail_out = static_cast<uInt>(buffer.size() - zstream.total_out);
    zstream.next_out = reinterpret_cast<Bytef*>(buffer.data() + zstream.total_out);
    const int ret = inflate(&zstream, Z_NO_FLUSH);
    if (ret == Z_STREAM_END)
    {
      buffer.resize(zstream.total_out);
      return 0;
    }
    else if ((ret == Z_OK) && (zstream.avail_out == 0))
    {
      if (buffer.size() > (32 * 1024 * 1024)) // Something is going very wrong if we are decompressing more than 32MB and we don't want to get stuck in an infinite loop
      {

        return 2;
      }
      buffer.resize(buffer.size() + 4096);
    }
    else
    {

      return 3;
    }
  }
}

